import subprocess
import time
from rich.console import Console

# Initialize libraries
console = Console()

def print_slowly(text, color="grey on black", delay=0.25):
    """Print text with a delay between each character with a specified color."""
    for char in text:
        console.print(char, style=color, end='')
        time.sleep(delay)
    console.print()  # Move to a new line after finishing

def main():
    # Display coordination found title
    console.print("\n\nCoordination Found\n\n", style="bold blue")
    time.sleep(5)  # Pause for 5 seconds

    # Display target location with green color and underlined
    console.print("Target Location", style="bold green underline")

